import React from "react";

function Header(props) {
  return (
    <nav className="flex border-2 border-rose-500">
      <h4 className="flex-auto">this is the header</h4>
      <section>
        Dark Mode:
        <input
          className="flex-auto"
          type="checkbox"
          onClick={props.toggleDarkMode}
        />
      </section>
    </nav>
  );
}

export default Header;
